window.bookSummaryJSON = "<p><b>When three dominant cowboys take over my ranch, they want more than just my land.</b></p> <p>It's their rules now. And this innocent girl is about to break every single one of them.</p> <p>Living alone on my family's ranch was supposed to be peaceful. But then the Hellstone triplets moved in next door, turning my world upside down.</p> <p>Keaton Hellstone, the playful tease, always has a mischievous grin that promises trouble. His passion and adventurous spirit keep me constantly on edge.</p> <p>Owen Hellstone, the aggressive and dominant one, commands attention with his raw, primal energy. Every encounter with him is a mix of fear and excitement.</p> <p>Gray Hellstone, the calm and authoritative mediator, knows how to read my every emotion. His steady presence provides comfort, even when I'm at my most vulnerable.</p> <p>One heated night with all three of them changed everything. Caught in their irresistible charm, I found myself tangled in their arms, breaking every rule I thought I had.</p> <p>Now, the pregnancy test stares at me with two pink lines and things just went from wild to downright crazy. Will the Hellstone triplets become the family I've always wanted, or will this wild romance end in heartbreak?</p> <p>Cowboy Triplets Next Door <i>is a steamy reverse harem romance that blends humor, heart, and heat. Join Billie and the Hellstone triplets in an unforgettable tale of passion, adventure, and unexpected love. A guaranteed HEA with every fiery twist and turn! For mature listeners.</i></p>"; 
